function TodoForm() {
    const clickOnButton = (event) => {
        event.preventDefault()
    }

    return (
        <form>
            <input type="text" />
            <button onClick={clickOnButton} type="submit">
                Submit
            </button>
        </form>
    )
}

export default TodoForm
